import React from "react";
import {
    ResponsiveContainer,
    ComposedChart,
    AreaChart,
    LineChart,
    Line,
    Area,
    PieChart,
    Pie,
    Cell,
    YAxis,
    XAxis,
    Legend,
    Tooltip,
    BarChart,
    Bar
  } from "recharts";
const ProductChartData = getDashboardData();

const SecCharts = props => {
  let { chartState, stats, level, color, data } = props;
console.log(ProductChartData)
  switch (chartState) {
    case "overall":
      return <ResponsiveContainer width="100%" minWidth={500} height={350}>
      <PieChart
        margin={{ top: 0, right: -15, left: -15, bottom: 0 }}
        data={data}
      >
        <Pie data={data} dataKey={stats} nameKey={level} label>
        {

          data.map((entry, index) => <Cell key={`cell-${index}`} fill={color[index % color.length]} />)
        }
        </Pie>
      </PieChart>
    </ResponsiveContainer>

      break;
    case "dashboard":
      return <ResponsiveContainer width="100%" minWidth={500} height={350}>
      <PieChart
        margin={{ top: 0, right: -15, left: -15, bottom: 0 }}
        data={data}
      >
        <Pie data={data} dataKey={stats} nameKey={level} label>
        {

          data.map((entry, index) => <Cell key={`cell-${index}`} fill={color[index % color.length]} />)
        }
        </Pie>
      </PieChart>
    </ResponsiveContainer>
      break;
    default:
      return null;
  }
};

export default SecCharts;

function getDashboardData() {
    var resultArray = [];
    var stats = [31.7,52.4,15.9,0];
    let level = ["Informational","Low","Medium","High"]
    for (let i = 0; i < level.length; i++) {
      resultArray.push({
        stats: stats[i],
        level: level[i]
      });
    }
    return resultArray;
  }
